import { round } from 'lodash-es';
const isLegendItemI = legendItems => {
  return !Array.isArray(legendItems[0].value);
};
export const getColorLegendItems = legendItems => {
  if (isLegendItemI(legendItems)) {
    return legendItems;
  }
  // TODO: scale nice
  const items = legendItems.map(item => Object.assign(Object.assign({}, item), {
    value: [round(item.value[0], 4), round(item.value[1], 4)]
  }));
  return items;
};
